import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

ReactDOM.render(
  <Router>
    <Header />
    <Routes>
      <Route path="/" element={<Temp></Temp>} />
      <Route path="/about" element={<Temp></Temp>} />
      <Route path="/contact" element={<Temp></Temp>} />
    </Routes>
  </Router>,

  document.getElementById("root")
);
const Temp = () => {
  return <div>Temp</div>;
};
